--(17,'2023-03-30 07:10:22','2023-03-30 07:10:26','캐나다','브리티시컬럼비아','벤쿠버','잉글리시 베이 ','https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Nation/04d72c0a-8004-47a6-945a-79bcdc9be6a8.png','오늘 밴쿠버 파이어워크 페스티벌 왔는데 한국 팀 하는 건데 진짜 멋지네요. 어떻게 진짜 한국에서도 이런 거 있었으면 좋겠네요.',12.770975112915039,'https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Voice/8aca97a3-5139-40fd-9eac-e608f88cbf66.wav',2,6),
--(18,'2023-03-30 07:11:12','2023-03-30 07:11:15','미국','오리건','시애틀','스타벅스','https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Nation/b1727ef1-0f58-4e55-af4c-f40495c99437.png','여기 지금 스타트 벅스 본점에 와 있는데 제가 이런 곳 에 와볼 거라고는 생각도 못 해봤는데 텀블러 살까 말까 고민했는데 텀블러는 안 사겠습니다. 나중에 후회할지 모르겠는데',13.467574119567871,'https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Voice/71f662a8-5619-4707-9488-a2c7b49350eb.wav',1,7),
--(19,'2023-03-30 07:11:59','2023-03-30 07:12:04','캐나다','브리티시컬럼비아','벤쿠버','그라우스마운틴','https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Nation/04d72c0a-8004-47a6-945a-79bcdc9be6a8.png','여기 지금 그라우스 마운틴이 올라왔는데 지금 아직 5월인데도 불구하고 너무 아 고도 높은 곳에 처음. 와봤는데 진짜 춥네요.',12.58521556854248,'https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Voice/26984059-57a3-44d3-8fec-574d6abc05e5.wav',2,8),
--(20,'2023-03-30 07:12:47','2023-03-30 07:12:54','미국','로스앤젤레스','센디에고','라호야비치','https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Nation/b1727ef1-0f58-4e55-af4c-f40495c99437.png','라호야 비치라고 여 기 야생 물개들이 와서 쉬는 서식지라고 합니다. 별로 냄새가 심할 줄 알았는데 냄새는 안 나고 귀엽긴 하네요. 근데',13.374693870544434,'https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Voice/69575358-3762-420b-b9f0-5986b39eccc5.wav',1,9),
--(21,'2023-03-30 07:14:46','2023-03-30 07:14:51','캐나다','알버타','로키','밴프 국립공원','https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Nation/04d72c0a-8004-47a6-945a-79bcdc9be6a8.png','이거 포르시의 올드카입니 다. 여기 아까 동호회 하던데 진짜 멋지네요. 저도 저런 차 하나 사고 싶습니다. 진짜 정말 멋지네요 소리 소리',12.44589614868164,'https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Voice/85d27009-6491-44a8-99b6-c5af84722b29.wav',2,10),
--(22,'2023-03-30 07:15:26','2023-03-30 07:15:29','미국','로스앤젤레스','센디에고','포테이토칩 락','https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Nation/b1727ef1-0f58-4e55-af4c-f40495c99437.png','이게 포테이토 칩스라인데 저 밑에 진짜 낭떨어집니다. 진짜 무서워요. 근데 저 바위가 안 부서지는지는 모르겠는데 진짜 아찔하긴 하네요.',12.538775444030762,'https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Voice/3b71bafe-338b-47e9-873b-fc4b8f36feda.wav',1,11),
--(23,'2023-03-30 07:16:46','2023-03-30 07:16:52','캐나다','알버타','로키','밴프 국립공원','https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Nation/04d72c0a-8004-47a6-945a-79bcdc9be6a8.png','여러분들 로키마운트입니다. 로키 마운트 이거 진짜 넓네 산이 어떻게 저렇게 높지 말이 안 된다 말',11.377778053283691,'https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Voice/4562f899-9845-4d5f-8b3a-e0774de69d1b.wav',2,12),
